    - Study Microchip Secure IC
    - "Current Microchip Secure IC documents are in ftp://10.1.13.71/Public/05_Vendors/Microchip/
      \r\n\r\n<pre>\r\nHi Keep,\r\n\r\n          OK.  要做的事情很多，我們需要再與 Fred 確認這件事情的
      Priority \r\n\r\nHi All,\r\n\r\n          今天跟 Keep / Markii 討論了關於 Secure IC
      的部分，整理內容如下： (有誤再請 Keep / Markii / Eric 幫忙指正)\r\n\r\n1.\t  Communication Security
      包含 認證與傳輸加密，\r\n甲、\t認證部分需要使用非對稱 key ，在被認證端放 private key / certificate ，在認證端放
      public key\r\n乙、\t傳輸加密通常是透過 AES，因為非對稱 key 運算效能不好\r\n\r\n2.\tMicrochip Secure
      IC\r\n甲、\t可以存 1 組 public  or private key 加上 AES key，但無法同時存 Public + Private
      key\r\n乙、\t存 Private key 是讀不出來的 (這個也是這顆 Chip 設計的主要目的)，但是可以把資料送進去用 Private key
      去 encrypt ，達成數位簽章與認證的目的\r\n丙、\tPublic key 可以讀出來，也可以用來 Decrypt 被 private key
      去 encrypt 過的數位簽章\r\n\r\n3.\tDoorbell \r\n甲、\t可以用 Secure IC 去存 private key /
      certificate ，用來認證 device 是合法的\r\n乙、\tPublic key 不怕洩漏，可以存在 Flash ，但是最好也是存在 EFUSE
      / OTP ，避免被竄改\r\n丙、\t使用 Private key 的部分，可以利用 secure IC 去 encrypt ，然後再用 S/W 去包裝成
      HTTP / HTTPS 等 application 的 protocol\r\n丁、\t使用 Public key 的部分，可以純粹用CPU 的 calculating
      power ，\r\n戊、\tAES 部分可以用 CPU 或是 Secure IC (需要 porting library 去使用 secure IC)\r\n\r\n4.\tDoorlock\r\n甲、\t傳輸部分都由
      Redpine 來做，包含 BLE / Wi-Fi\r\n乙、\tBLE 部分的 key 都是動態產生的 ( ? )，所以沒有存 key 問題\r\n丙、\tWi-Fi
      部分，如果目前考慮走 AWS IoT ，會需要儲存 2組certificate (包含認證 AWS IoT Cloud 與 被認證) 與 1 組 private
      key，這些目前都是由 STM call SDK 去傳給 Redpine firmware ，然後去做 secured network \r\n丁、\t但是很明顯的，如果我們把
      private key 放在 Secure IC 是讀不出來的，但是我們也不能把 message 給 secure IC 去 encrypt  後，再送給
      Redpine 。所以這邊要怎麼做，還得想看看\r\n\r\n5.\t如果 BLE 不需要 key ，那 Latch 放 Secure IC 的目的也許可能是防山寨。\r\n\r\n6.\t過去
      R 公司是沒有用 Secure IC ，只有把 key 放在 Flash OTP / EFUSE ，增加讀取難度 (但是還是可以讀取出來)，也防止竄改。\r\n\r\n</pre>\r\n"
