    - "Attach the related emails\r\n\r\n<pre>\r\n我 Summarize 週五與 Shine 的測試結果，請幫忙確認。\r\n\r\nEcho
      Cancellation 的效果好壞，主要取決於音質與 Acoustic Path (聲音自喇叭至麥克風的路徑)：\r\n\r\n-\tPlay / Record
      的聲音音質：\r\n\tCapture Volume Gain 太大會導致錄音音質破壞，所以後來改成 60%\r\n\tPlayback Volume
      Gain 太大會導致播放音質破壞，所以後來改成 80%\r\n\tDAC1 (未經過 DSP) / DAC2 (經過 DSP) 同時輸出也會破壞播放音質，所以把
      DAC1 關掉 (所以設置 \"Stereo DAC MIXL DAC L1 / R1 Switch\" 0 )\r\n\t可以用  Audacity
      來確認播放與錄回的音質 (Wave Form) 是否被破壞，也可以觀察 Volume 變化來檢測 AEC 效果\r\n\t通常 AEC 的效果是可以降低
      10 dB ?，所以  Playback Volume太大就無法完全 Cancel\r\n\t可以用 Local play / record 的方式，來先排除
      network 掉包造成的問題。\r\n\r\n Command:  “arecord -f S16_LE -r 16000 | aplay -f S16_LE
      -r 16000”\r\n\r\n-\tAcoustic Path\r\n\t喇叭播放出來的聲音，被 Mic 收進去可能是透過機構外或是機構內，所以要分成外氣密測試與內氣密測試\r\n\t外氣密測試：Device單純錄音，由另外
      speaker播放聲音，用黏土蓋住 Mic 孔，必須要能有效降低錄音音量 (10dB?)，目的是證明所有錄到的聲音，都是來自於 Mic 孔收到\r\n\t內氣密測試：Device
      自播自錄，一樣用黏土蓋住 Mic 孔，必須要能有效降低錄音音量(10 dB?)，目的是證明錄到的聲音不是透過機構內部傳導到 Mic 。(如果內部聲音傳導存在，蓋住
      Mic 孔反而會因為聲音出不去，造成錄到的聲音反而變大)\r\n\t可以先用裸版 PCBA 測試 AEC，先初步排除機構，只驗證 AEC 功能\r\n\r\n</pre>"
