      postgres 10.4\r\nTo : CTC Server: gitlab omnibus 12.9.3 + postgres 10.12\r\n\r\n1.
      back up gitlab from Nas (gitlab source 11.11.8)\r\n\r\n// login gitlab container\r\n$
      \r\nsudo docker exec -it synology_gitlab bash\r\n\r\n// generate backup file\r\n!#
      \r\nsudo -u git -H bundle exec rake gitlab:backup:create RAILS_ENV=production\r\n\r\nthis
      will create a backup file at \"/home/git/data/backups\" (not default /var/opt/gitlab/backups)\r\n\r\n2.
      backup related files (config ...etc)\r\n\r\nFor installation from source:\r\n/home/git/gitlab/config/secrets.yml\r\n/home/git/gitlab/config/gitlab.yml\r\n\r\nFor
      Omnibus: (not this one)\r\n/etc/gitlab/gitlab-secrets.json\r\n/etc/gitlab/gitlab.rb\r\n\r\n3.
      copy backup files (step1 & step2) to new server\r\n\r\n4. run the same gitlab
      version by docker on new server (gitlab omnibus 11.11.8)\r\n\r\n5. restore from
      back up files\r\n\r\n// login gitlab container\r\n$ \r\nsudo docker exec -it
      gitlab bash\r\n\r\n5.1 stop connectivity services\r\n!# \r\ngitlab-ctl stop
      unicorn\r\ngitlab-ctl stop sidekiq\r\ngitlab-ctl status\r\n\r\n5.2 restore from
      *.tar (command example)\r\n// Warning: gitlab-rake gitlab:backup:restore does
      not set the right file system permissions on your Registry directory.\r\n!#\r\ngitlab-rake
      gitlab:backup:restore BACKUP=1587124814_2020_04_17_11.11.8\r\n\r\n5.3 re-configure
      & re-start\r\n!# \r\ngitlab-ctl reconfigure\r\ngitlab-ctl restart\r\n\r\n5.4
      check (wait for a while)\r\n!# \r\ngitlab-rake gitlab:check SANITIZE=true\r\n\r\n5.5
      fix errors:\r\n// fix check result errors\r\n!#\r\nchown -R git /var/opt/gitlab/gitlab-rails/uploads\r\nfind
      /var/opt/gitlab/gitlab-rails/uploads -type f -exec chmod 0644 {} \\;\r\nfind
      /var/opt/gitlab/gitlab-rails/uploads -type d -not -path /var/opt/gitlab/gitlab-rails/uploads
      -exec chmod 0700 {} \\;\r\n\r\n// fix this issue in psql : PG::NotNullViolation:
      ERROR:  null value in column \"id\" violates not-null constraint\r\n!#  \r\ngitlab-psql\r\n\r\ngitlabhq_production=#
      \r\n\r\nSELECT MAX(id)+1 FROM project_ci_cd_settings;\r\nCREATE SEQUENCE project_ci_cd_settings_id_seq
      MINVALUE 100;\r\nALTER TABLE project_ci_cd_settings ALTER id SET DEFAULT nextval('project_ci_cd_settings_id_seq');\r\nGRANT
      USAGE, SELECT ON SEQUENCE project_ci_cd_settings_id_seq to gitlab;\r\n\r\nSELECT
