    - "h1. Redmine usage guideline\r\n\r\n{{toc}}\r\n\r\n------\r\n\r\nh2. Trackers
      \r\n\r\n* Bug\r\n** Crash, function not work, ...\r\n** Need verification\r\n\r\n*
      Feature\r\n** New functions\r\n** Need verification\r\n\r\n* Task\r\n** Split
      Subtask \r\n** Study\r\n\r\n------\r\n\r\nh2. Priority\r\n\r\n* P0(Immediate)\r\n**
      Fix it ASAP\r\n\r\n* P1(Urgent)\r\n** Fix this in a week\r\n\r\n* P2(High)\r\n**
      Lower than P0 / P1, but higher than normal\r\n\r\n* P3(Normal)\r\n** Default
      priority\r\n\r\n* P4(Low)\r\n** Lower priority, could be fixed later after all
      other issue fixed\r\n\r\n------\r\n\r\nh2. Issue Statuses\r\n\r\n* *New*\r\n**
      Newly assigned\r\n\r\n* *Accepted* \r\n** Confirmed to be your tickets \r\n**
      If issue is not yours, please reassign to other people\r\n\r\n* *In Progress*\r\n**
      Being under development\r\n\r\n* *Resolved*\r\n** Fix committed by not verified\r\n\r\n*
      *Closed*\r\n** Verified after *Resolved*\r\n\r\n* *Won't Fix*\r\n** No need
      to fix. (e.g. not an invalid bug, or decided not to go)\r\n\r\n\r\n------\r\n\r\nh2.
      Issue Process\r\n\r\n* Create tickets by your own when\r\n** Split bugs / features
      to subtasks\r\n** Being assigned new features\r\n** New issues is found\r\n\r\n\r\n------\r\n\r\nh2.
      To-Do\r\n\r\n* Email notification\r\n\r\n* Integrate Redmine issues with gitlab\r\n**
      Link changeset to Redmine issue\r\n** Update Redmine issue status when commit
      to gitlab\r\n** Can click link in in Redmine issue to open changeset "
